import React from "react";
import { isAuthenticated, logout } from "../utils/auth";

const ClientProfile = () => {
  if (!isAuthenticated()) {
    window.location.href = "/login";
    return null;
  }

  return (
    <div>
      <h2>Welcome to the Client Profile Page!</h2>
      <button onClick={logout}>Logout</button>
    </div>
  );
};

export default ClientProfile;
